  // Chart function을 사용할 때 CharProps Object가 들어오면, 그 중 coinId를 사용

  const { isLoading, data } = useQuery(["ohlcv", coinId], () =>
    fetchCoinHistory(coinId)
  );

  return <>Chart</>;
}

